// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awPopupCommandBarRenderFunction } from 'js/AwPopupCommandBarService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwCommandBarService', () => import('js/AwCommandBarService'));
registerDynImportEntry('js/AwPopupCommandBarService', () => import('js/AwPopupCommandBarService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "initialize": {
            "actionType": "JSFunctionAsync",
            "deps": "js/AwCommandBarService",
            "method": "awCommandBarInitFunction",
            "inputData": {
                "0": {
                    "anchor": "{{props.anchor}}"
                }
            },
            "outputData": {
                "commandList": "commandList",
                "trace": "trace"
            }
        },
        "refreshServerVisibility": {
            "actionType": "JSFunctionAsync",
            "deps": "js/AwCommandBarService",
            "method": "refreshServerVisibility",
            "inputData": {
                "0": {
                    "anchor": "{{props.anchor}}",
                    "commandList": "{{data.commandList}}",
                    "visibilityLoader": "{{props.visibilityLoader}}",
                    "trace": "{{data.trace}}"
                }
            },
            "outputData": {
                "visibleServerCommands": ""
            },
            "events": {
                "success": [
                    {
                        "name": "nxCommands.update",
                        "condition": "ctx.aw_hosting_enabled && ctx.aw_host_type === 'NX'",
                        "eventData": {
                            "name": "visibleServerCommands",
                            "data": ""
                        }
                    }
                ]
            }
        },
        "render": {
            "method": "awPopupCommandBarRenderFunction",
            "options": {
                "elementRefList": [
                    "commandBar"
                ]
            },
            "deps": "js/AwPopupCommandBarService"
        }
    },
    "lifecycleHooks": {
        "onMount": "initialize",
        "render": "render",
        "onUpdate": {
            "action": "refreshServerVisibility",
            "observers": [
                "props.visibilityLoader",
                "viewModel.data.commandList"
            ]
        }
    },
    "props": {
        "alignment": {
            "type": "string"
        },
        "anchor": {
            "type": "string"
        },
        "child-command-click-callback": {
            "type": "object"
        },
        "visibility-loader": {
            "type": "object"
        },
        "context": {
            "type": "object"
        }
    },
    "_viewModelId": "AwPopupCommandBar",
    "_uniqueViewModelId": "AwPopupCommandBar",
    "ctx": {
        "aw_hosting_enabled": {
            "type": "object"
        },
        "aw_host_type": {
            "type": "object"
        }
    }
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awPopupCommandBarRenderFunction, {"elementRefList":["commandBar"]}, ctxImportObj );

export default Component;
